import React from "react";
import "./Header.css";
import GameMessage from "../GameMessage";

const Header = props => (
    <div className="header">
        <ul>
            <li><h2>Clicky Game</h2></li>
            <GameMessage score={props.score} topScore={props.topScore} />
            <li id="score">Score: {props.score} | Top Score: {props.topScore}</li>
            <a href="html-image-hyperlink.php"><img src="../../../assets/images/veggieman.jpg"/></a>        </ul>

    </div>
)

export default Header;
